#!/usr/bin/env python3
from common import *

our_rna = ''
lens = [400, 500, 600, 700, 800, 900]

def run_for_alg(alg):
  print('alg ' + alg)
  for l in lens:
    res, _ = benchmark_command(
      './build/subopt', '-q', '-num', '5000', '-subopt-alg', alg, our_rna[:l])
    print('  len %d: %s' % (l, res))

def main():
  run_for_alg('2')
  run_for_alg('1')
  run_for_alg('0')

if __name__ == '__main__':
  main()
